import React from "react";
import map from "./map.png";

function Landing() {
  return (
    <div>
      <div className="landing">
        <img src={map} style={{ display: "flex", width: "100%" }}></img>
        <ListItem component={Link} to="/HOME">
          <ListItem button>HOME</ListItem>
        </ListItem>
      </div>
    </div>
  );
}

export default Landing;
